   import ArcoVueIcon from '@arco-design/web-vue/es/icon';
   import '@arco-design/web-vue/dist/arco.css';
   // css
   import "arco-vue3-supertable/dist/arco-vue3-supertable.css";
   const app = createApp(App);
   // 
   Supertable.install(app)
   app.use(ArcoVue);
   // icon 
   app.use(ArcoVueIcon);
   app.mount('#app');

